        font-weight: 600
    }

    .main-area .social-btn {
        position: absolute;
        bottom: 30px;
        width: 100%;
        left: 50%;
        transform: translateX(-50%)
    }

    .main-area .social-btn .list-heading {
        display: block;
        margin-bottom: 15px
    }

    .main-area .social-btn>li>a>i {
        display: inline-block;
        height: 35px;
        width: 35px;
        line-height: 35px;
        border-radius: 40px;
        font-size: 1.04em;
        margin: 0 5px
    }

    .main-area .social-btn>li>a>i:hover {
        background: #fff !important
    }

    .main-area .social-btn>li>a>i[class*=facebook] {
        background: #2a61d6
    }

    .main-area .social-btn>li>a>i[class*=twitter] {
        background: #3aa4f8
    }

    .main-area .social-btn>li>a>i[class*=google] {
        background: #f43846
    }

    .main-area .social-btn>li>a>i[class*=instagram] {
        background: #8f614a
    }

    .main-area .social-btn>li>a>i[class*=pinterest] {
        background: #e1c013
    }

    @media only screen and (max-width:767px) {
        p {
            line-height: 1.4
        }

        h1 {
            font-size: 2.8em;
            line-height: 1
        }

        .main-area-wrapper {
            height: 100%;
            padding: 0
        }

        #normal-countdown .time-sec {
            height: 70px;
            width: 70px;
            margin: 5px
        }

        #normal-countdown .time-sec .main-time {
            line-height: 55px;
            font-size: 1.8em
        }

        #normal-countdown .time-sec span {
            bottom: 12px
        }
    }

    @media only screen and (max-width:479px) {
        body {
            font-size: 12px
        }

        #normal-countdown .time-sec {
            height: 60px;
            width: 60px;
            margin: 5px
        }

        #normal-countdown .time-sec .main-time {
            line-height: 45px;
            font-size: 1.5em
        }
    }
</style>

    <script data-template-shadow-root>
        (() => {
            document.currentScript.remove();
            processNode(document);

            function processNode(node) {
                node.querySelectorAll("template[shadowroot]").forEach(element => {
                    let shadowRoot = element.parentElement.shadowRoot;
                    if (!shadowRoot) {
                        try {
                            shadowRoot = element.parentElement.attachShadow({
                                mode: element.getAttribute("shadowroot")
                            });
                            shadowRoot.innerHTML = element.innerHTML;
                            element.remove()
                        } catch (error) {}
                        if (shadowRoot) {
                            processNode(shadowRoot)
                        }
                    }
                })
            }
        })()
    </script>
